import React from 'react';

const VideoItem = ({video}) => {
    return (
        <div className='flexContainer button p-10 m-1 r-10 bg-lite color-yellow'>
            <div className="flex2Column">
                <img alt={video.title} src={video.thumb} />
            </div>
            <div className="flex2Column columnLeft pl-10">
                <div className='copyright bold'>{video.channel}</div>
                <div className='small bold white'>{video.title}</div>
                <div className='copyright'>{video.published.substring(0,10)}</div>
            </div>
        </div>
    ) 
};

export default VideoItem;
